import React, { useState, useEffect } from "react";
import Header from "./components/Header";
import SearchBar from "./components/SearchBar";
import CategoryList from "./components/CategoryList";
import MovieList from "./components/MovieList";
import LoadMoreButton from "./components/LoadMoreButton";
import Footer from "./components/Footer";
import MovieModal from "./components/MovieModal";
import cinecaptionTTF from "./fonts/cinecaption226.ttf";
import playfairDisplayTTF from "./fonts/PlayfairDisplay-VariableFont_wght.ttf";
import "./styles.css";
import "./App.css";

function App() {
  const [searchQuery, setSearchQuery] = useState("");
  const [selectedCategory, setSelectedCategory] = useState("upcoming");
  const [visibleCount, setVisibleCount] = useState(8);

  // モーダル管理のstate
  const [modalOpen, setModalOpen] = useState(false);
  const [modalMovieId, setModalMovieId] = useState(null);
  const [modalTitle, setModalTitle] = useState("");

  // 【追加】恐怖要素報告一覧のstate
  const [fearReports, setFearReports] = useState([]);

  useEffect(() => {
    const style = document.createElement("style");
    style.textContent = `
      @font-face {
        font-family: 'Cinecaption';
        src: url(${cinecaptionTTF}) format("truetype");
        font-weight: normal;
        font-style: normal;
      }
      @font-face {
        font-family: 'Playfair Display';
        src: url(${playfairDisplayTTF}) format("truetype");
        font-weight: normal;
        font-style: normal;
      }
    `;
    document.head.appendChild(style);

    return () => {
      document.head.removeChild(style);
    };
  }, []);

  const handleSearch = (query) => {
    setSearchQuery(query);
    setVisibleCount(8);
  };

  const handleCategoryChange = (newCategory) => {
    setSelectedCategory(newCategory);
    setSearchQuery("");
    setVisibleCount(8);
  };

  const handleLoadMore = () => {
    setVisibleCount((prevCount) => prevCount + 8);
  };

  const openModalWithMovie = (id, title) => {
    setModalMovieId(id);
    setModalTitle(title);
    setModalOpen(true);
  };

  const closeModal = () => {
    setModalOpen(false);
    setModalMovieId(null);
    setModalTitle("");
  };

  // 【追加】恐怖要素報告を追加する関数
  const handleAddFearReport = (report, movieId) => {
    setFearReports(prev => [...prev, { ...report, movieId }]);
    alert("恐怖要素を報告しました！");
  };

  return (
    <div className="App">
      <Header />
      <SearchBar onSearch={handleSearch} />
      <CategoryList
        selectedCategory={selectedCategory}
        onSelectCategory={handleCategoryChange}
      />
      <MovieList
        category={selectedCategory}
        query={searchQuery}
        visibleCount={visibleCount}
        onMovieClick={openModalWithMovie}
      />
      <LoadMoreButton onClick={handleLoadMore} />
      <Footer />

      {/* モーダルにonAddFearReport関数を渡す */}
      <MovieModal
        isOpen={modalOpen}
        onClose={closeModal}
        movieId={modalMovieId}
        title={modalTitle}
        onAddFearReport={handleAddFearReport}  // ← ここを追加
      />

      {/* 【オプション】報告一覧の表示 */}
      <div style={{ padding: "1rem" }}>
        <h3>報告一覧</h3>
        {fearReports.length === 0 ? (
          <p>報告はまだありません。</p>
        ) : (
          <ul>
            {fearReports.map((report, i) => (
              <li key={i} style={{ marginBottom: "1rem" }}>
                <strong>映画ID:</strong> {report.movieId} <br />
                <strong>種類:</strong> {report.types.join(", ")} <br />
                <strong>詳細:</strong> {report.detail} <br />
                <strong>時間:</strong> {report.time || "なし"}
              </li>
            ))}
          </ul>
        )}
      </div>
    </div>
  );
}

export default App;
